import React from 'react'

export default function FullEventCard(props) {
    return (
        <div>
            <div>{props.fullClassData.classTitle}</div>
            <div>
                <div>{props.fullClassData.classTime.hour}:{props.fullClassData.classTime.minutes}</div>
            </div>
        </div>
    )
}
